import{_ as e,c as r,o as i,a}from"./app.07171ad0.js";const g=JSON.parse('{"title":"DNS Prefetching","description":"","frontmatter":{},"headers":[{"level":2,"title":"什么时候我们需要 DNS Prefetching ?","slug":"什么时候我们需要-dns-prefetching","link":"#什么时候我们需要-dns-prefetching","children":[]},{"level":2,"title":"DNS Prefetching真的对首屏优化有效吗？","slug":"dns-prefetching真的对首屏优化有效吗","link":"#dns-prefetching真的对首屏优化有效吗","children":[]},{"level":2,"title":"一个页面一般包含哪些资源？","slug":"一个页面一般包含哪些资源","link":"#一个页面一般包含哪些资源","children":[]},{"level":2,"title":"哪些资源符合 preload 的特点呢？","slug":"哪些资源符合-preload-的特点呢","link":"#哪些资源符合-preload-的特点呢","children":[]}],"relativePath":"performanceOptimization/预解析&预加载&预链接.md"}'),t={name:"performanceOptimization/预解析&预加载&预链接.md"},n=a('<h1 id="dns-prefetching" tabindex="-1">DNS Prefetching <a class="header-anchor" href="#dns-prefetching" aria-hidden="true">#</a></h1><h2 id="什么时候我们需要-dns-prefetching" tabindex="-1">什么时候我们需要 DNS Prefetching ? <a class="header-anchor" href="#什么时候我们需要-dns-prefetching" aria-hidden="true">#</a></h2><ul><li>该页面一般作为用户访问的入口页面</li><li>在用户的访问链路上必经场景，比如：登陆页的下一跳</li><li>某些静态资源，分布在页面各个区域</li></ul><h2 id="dns-prefetching真的对首屏优化有效吗" tabindex="-1">DNS Prefetching真的对首屏优化有效吗？ <a class="header-anchor" href="#dns-prefetching真的对首屏优化有效吗" aria-hidden="true">#</a></h2><p>无效，DNS Prefetching 虽然是性能优化的其中一环，但是它对首屏加载并没有效果。</p><p>Chromium内核对DNS Prefetching的实现，并没有使用浏览器自身的网络堆栈，启动了8个异步的worker线程专门负责DNS预解析。<strong>因此DNS预解析与首屏加载没有直接关系，既不会加速首屏渲染，也不会阻塞首屏渲染</strong>。</p><p>在window上，没有对异步DNS解析的原生支持。</p><p><a href="https://www.chromium.org/developers/design-documents/dns-prefetching/" target="_blank" rel="noreferrer">DNS Prefetching</a></p><h1 id="preload" tabindex="-1">Preload <a class="header-anchor" href="#preload" aria-hidden="true">#</a></h1><h2 id="一个页面一般包含哪些资源" tabindex="-1">一个页面一般包含哪些资源？ <a class="header-anchor" href="#一个页面一般包含哪些资源" aria-hidden="true">#</a></h2><ul><li>监控上报的JavaScript</li><li>埋点/曝光上报的JavaScript</li><li>JavaScript Bridge</li><li>公共CSS（字体、reset css、视觉设计颜色集、适配移动端）</li><li>第三方库（React、ReactDOM、antd等）</li><li>业务JS</li><li>业务CSS</li></ul><h2 id="哪些资源符合-preload-的特点呢" tabindex="-1">哪些资源符合 preload 的特点呢？ <a class="header-anchor" href="#哪些资源符合-preload-的特点呢" aria-hidden="true">#</a></h2><h1 id="prefetch" tabindex="-1">prefetch <a class="header-anchor" href="#prefetch" aria-hidden="true">#</a></h1>',13),h=[n];function d(l,c,s,o,p,f){return i(),r("div",null,h)}const S=e(t,[["render",d]]);export{g as __pageData,S as default};
